let response = response_body;
if(!response_iserror){
     response = request_vendor_body;
}else{
  response = response_body_raw;
}

done({
  response_body : JSON.parse(response)
});

let response_body_new=response_body;
if(!response_iserror){
  response_body_new = response_body[0];
}
done({
  response_body : response_body_new
});

let request_vendor_headers_new= request_vendor_headers;
request_vendor_headers_new['X-Atlassian-Token'] = 'nocheck';
request_vendor_headers_new['Content-Type']='multipart/form-data';
done({
  request_vendor_headers : request_vendor_headers_new
});

let request_body_new = JSON.parse(request_body);
let parentIncidentId = request_path_variables['id'];
let projects = {
      "id": parentIncidentId
};
request_body_new.fields['parent'] = projects;
done({
  request_vendor_body : JSON.stringify(request_body_new)
});

let body = JSON.parse(request_vendor_body);
if(body.adjustEstimate){
  delete body.adjustEstimate;
}
if(body.newEstimate){
  delete body.newEstimate;
}
if(body.reduceBy){
  delete body.reduceBy;
}
done({
  request_vendor_body : body
});

if(!configuration['username'] ||
   !configuration['siteAddress'] || 
   !configuration['password']) {
  done({
    response_body: "Missing configuration(s). Host Name, Username, & Password are required.", 
    continue: false})
}

let requestHeaders = {
  Authorization: `Basic ${CE.b64(configuration['username'] + ':' + configuration['password'])}`
};

done({
  request_vendor_headers: requestHeaders
});

var formattedEvents = [];
var eventObj = {};
var providerEvent = events;
var webhook_types = events.webhookEvent;

if (webhook_types) {
    //Jira On Prem has an option to send empty event body from webhooks configuration
    //The above check is just to make sure we don't process event if it is empty
    if (webhook_types.endsWith('created')) {
        eventObj.event_type = 'CREATED';
    } else if (webhook_types.endsWith('updated')) {
        eventObj.event_type = 'UPDATED';
    } else if (webhook_types.endsWith('deleted')) {
        eventObj.event_type = 'DELETED';
    }

    if (webhook_types.startsWith('project')) {
        eventObj.event_object_type = 'projects';
        eventObj.event_object_id = events.project.id;
    } else if (webhook_types.startsWith('user')) {
        eventObj.event_object_type = 'agents';
        eventObj.event_object_id = events.user.key;
    } else if (webhook_types.startsWith('jira:issue')) {
        eventObj.event_object_type = 'incidents';
        eventObj.event_object_id = events.issue.id;
    } else if (webhook_types.startsWith('comment')) {
        eventObj.event_object_type = 'incidentsComments';
        eventObj.event_object_id = events.comment.id;
    } else if (webhook_types.startsWith('worklog')) {
        eventObj.event_object_type = 'incidentsWorklogs';
        eventObj.event_object_id = events.worklog.id;
    }
    formattedEvents.push(eventObj);
}

done({
    "events": formattedEvents
});
